import { Button, Heading, Main, Paragraph, SectionBreak } from "govuk-react";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Navigation from "../../../Navigation";

function BookConfirm() {
  const [selectedDate, setSelectedDate] = useState("");
  const [selectedTime, setSelectedTime] = useState("");
  const [selectedDoctor, setSelectedDoctor] = useState("");

  const navigate = useNavigate();

  const handleClick = () => {
    // Perform any action needed on confirmation
    navigate("/Application");
  };

  return (
    <div>
      <Navigation
        pageLink1="/"
        PageName1="home"
        pageLink2="/login"
        PageName2="Login"
        pageLink3="/NhsNumber"
        PageName3="Register"
      />

      <Main>
        <Heading>Confirm your booking</Heading>

        <Heading size="MEDIUM">Your booking is:</Heading>

        <SectionBreak></SectionBreak>

        <Paragraph>Doctor: {selectedDoctor}</Paragraph>

        <Paragraph>Date: {selectedDate}</Paragraph>

        <Paragraph>Time: {selectedTime}</Paragraph>

        <Button onClick={handleClick}>Confirm</Button>

        <Button onClick={() => navigate("/GPServices")} buttonColour="GREY">
          Cancel
        </Button>
      </Main>
    </div>
  );
}

export default BookConfirm;
